            Crafted with :heart: by **gmanojisaac** <span style="margin:0 .15em;">â€¢</span> Follow on [GitHub](https://github.com/gmanoj.isaac)
          </markdown>
      </div>
    </div>


  `,
  styles: [`
  
  .footer {
        margin: 32px 0 8px;
  
        &-text {
          display: block;
          font-size: 13px;
          padding-top: 4px;
        }
      }
  
      .mat-fab,
      .mat-mini-fab {
        img {
          margin-bottom: 2px;
        }
      }
  
      .sticky {
        position: sticky;
        top: 80px;
      }
  
      .scrollup-button {
        margin:14px;
  
        &--fixed {
          position: fixed;
          bottom: 16px;
          right: 16px;
        }
      }  
  `]
})
